import React, { useState } from 'react';
import '../pages/styles/view.css';

const Veiw = () => {
  const [content, setContent] = useState('ここに内容を表示');

  return (
    <div className="view-container">
      <p style={{ backgroundColor: 'black', color: 'white' }}>{content}</p>
      <button>えさやり</button>
    </div>
  );
};

export default Veiw;
